import React from 'react';
import './Facing.css';

const Facing = (props) => {
console.log(props)
  return (
    <li className="facing-info">
    <h2 className="facing-info__shelf">
      {'sID:'+props.shelfID}
    </h2>
    <img  
        className="facing-info__upc" 
        src={require('../imgs/'+props.productUPC+'.png')} 
        alt = 'ProductImg'
    />
    <p  className="facing-info__gondola">
      {"Gond:"+props.displayfixtureID}
    </p>
    </li>
  );
};
export default Facing;
